var DRR = "https://drrr.com/room/?ajax=1&api=json"; //this variable is used in every AJAX request
var jsonBackUp; //used only in momoLive function

//Main AJAX request to send messages
var sendMSG = function(e){
	$.ajax({
		type:"POST",
		url:DRR,
		data:{
			message: e
		}
	});
};

//Bump function to send random phrases from bumpArray
//and clear console errors in order to prevent bot death
//executes every 10(ten) minutes
//commented commands can cause bugs, resulting in bot death
setInterval(function(){
	sendMSG(bumpArray[Math.floor(Math.random() * bumpArray.length)]);
	console.clear();
	//memorySave();
	//momoLive();
}, 600000);

//array of tripcodes. Owners of this tripcodes will have rights to kick and ban users
//first tripcode - moders[0] - will have rights to kick and ban other moderators
var moders = ["Miles/0442","DanteBufXI","hELLTBEAMQ","C3KSEd.XsU"];

//function to kick and ban users
//can be used only by moderators
//can't kick those whose tripcodes are considered moderators
//PROBABLY can accept 'unban=' command but idk, didn't test it
var kickOrBan = function(e,f){
	if (moders.includes(e.room.talks[0].from.tripcode)){
		for (usr of e.room.users){
			if (usr.id!=e.profile.id){
				if (!moders.includes(usr.tripcode)){
					if (e.room.talks[0].message.includes(usr.name)){
						console.clear();
						$.ajax({
							type:"POST",
							url:DRR,
							data: f+usr.id
						});
					}
				}
			}
		}
	}
};

//function to kick and ban everyone including moderators
//can be used only by first tripcode in array
//can't kick main moderator
var sudo = function(e,f){
	if (e.room.talks[0].from.tripcode==moders[0]){
		for (usr of e.room.users){
			if (usr.id!=e.profile.id){
				if (usr.tripcode!=moders[0]){
					if (e.room.talks[0].message.includes(usr.name)){
						console.clear();
						$.ajax({
							type:"POST",
							url:DRR,
							data: f+usr.id
						});
					}
				}
			}
		}
	}
};

//function to parse time of room existance
var calcDateSince = function(e){
    let t = "";
    if ("0" !== e) {
        let n = Math.abs((new Date).getTime() - 1e3 * e);
        let days = Math.floor(n / 864e5);
        n -= 864e5 * days;
        let hours = Math.floor(n / 36e5);
        n -= 36e5 * hours;
        let minutes = Math.floor(n / 6e4);
        n -= 6e4 * minutes;
        let seconds = Math.floor(n / 1e3);
        n -= 1e3 * seconds;
        t = days ? days + " дней, " + hours + " часов, " + minutes + " минут, " + seconds + " секунд" : hours ? hours + " часов, " + minutes + " минут, " + seconds + " секунд" : minutes ? minutes + " минут, " + seconds + " секунд" : seconds + " секунд";
    } else {
        t = "Не могу сказать.";
	}
    return t;
};

//function to send randomly chosen link from tyanUrlsArray
var sendTyan = function(){
	$.ajax({
		type:"POST",
		url:DRR,
		data:{
			message: ".",
			url: tyanUrlsArray[Math.floor(Math.random() * tyanUrlsArray.length)]
		}
	});
};

//function to send random element of jokeArray
var sendJoke = function(){
	sendMSG(jokeArray[Math.floor(Math.random() * jokeArray.length)]);
};

//function to send random link
var sendMusic = function(){
	$.ajax({
		type:"POST",
		url:DRR,
		data:{
			music:"music",
			name:"Случайная музыка",
			url: musicArray[Math.floor(Math.random() * musicArray.length)]
		}
	});
};

//array and function to parse this array to txt file and then download it
//currently unused
var memoryArray = ["Memory:"];
var memoryArrayLastLength = 1;
var memorySave = function(){
	if (memoryArray.length > memoryArrayLastLength) {
		let blob = new Blob(memoryArray, {type: 'text/plain'}),
		bloburl = window.URL.createObjectURL(blob);
		a = document.createElement('a'),
		a.download = 'memory.txt';
		a.href = bloburl;
		a.dataset.downloadurl = ['text/plain', a.download, a.href].join(':');
		e = document.createEvent('MouseEvents');
		e.initMouseEvent('click', true, false, window, 0, 0, 0, 0, 0, false, false, false, false, 0, null);
		a.dispatchEvent(e);
		window.URL.revokeObjectURL(bloburl);
		memoryArrayLastLength = memoryArray.length;
	}
};

//variables and function to play 'Spin the Bottle'
var userOne;
var userTwo;
var rollBottle = function(e){
	if (e.room.users.length > 2){
		do{
			userOne = e.room.users[Math.floor(Math.random() * e.room.users.length)];
			userTwo = e.room.users[Math.floor(Math.random() * e.room.users.length)];
		}while(userOne.id==e.profile.id || userTwo.id==e.profile.id || userOne.id==userTwo.id);
		sendMSG(userOne.name+" -> "+userTwo.name);
	} else {
		sendMSG("Слишком мало людей.");
	}
};

